import React from 'react'

export default function Lost() {
    return (
        <div style={{
            height: "100vh",
            display: "flex",
            alignItems: "center",
            alignContent: "center",
            justifyContent: "center",
            background: "radial-gradient(circle, #1f1f1f 40%, darkblue 40%, midnightblue 45%, #1f1f1f 45%)",
        }}>
            <h1 style={{
                color: "darkgrey",
                fontSize: "30px",
                margin: "0px",
                position: "absolute",
                top: "50%",
                left: "50%",
                transform: "translate(-50%, -50%)",
                fontWeight: "bold",
            }}>A  <span style={{
                color: "#3676ff",
            }}>life</span> was just <span style={{
                color: "#3676ff",
            }}>lost</span> because of  <span style={{
                color: "#3676ff",
            }}>you</span>? <span style={{
                fontSize: "15px",
                color: "#3676ff",
            }}>Without even knowing</span></h1>
        </div>
    )
}
